function sortMultipleListsByPattern(values, ...lists) {
  const indices = values.map((value, index2) => index2);
  indices.sort((a2, b) => values[a2] - values[b]);
  values.sort((a2, b) => a2 - b);
  lists.forEach((list) => {
    const sortedList = indices.map((index2) => list[index2]);
    list.length = 0;
    list.push(...sortedList);
  });
}
