function calculateElementLength(elements2, nodes2) {
  let listLength = [];
  elements2.forEach((element) => {
    const [nodeid1, nodeid2] = element;
    const node1 = nodes2[nodeid1];
    const node2 = nodes2[nodeid2];
    const [x1, , z1] = node1;
    const [x2, , z2] = node2;
    const dx = x2 - x1;
    const dz = z2 - z1;
    const length = Math.sqrt(dx * dx + dz * dz);
    listLength.push(length);
  });
  return listLength;
}
